import User from "../../models/USER-model";

function fetchRegistrate(login, email, password){

    if(login == "" || email == "" || password == ""){
        return false;
    }

    const user = new User();    
    const ret = user.registrate(login, email, password)

    if(ret.message){
        console.log(ret.message);
        return false;
    }
    console.log(ret);
    return true;
}

export default fetchRegistrate;
